// pragma solidity >=0.4.22 <0.8.0;
// import "./ERC721.sol";
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/utils/Counters.sol";
contract Register {
    using Counters for Counters.Counter;
    address payable public owner; //Owner is also a maintainer
    bool public stopped=false;
    string public petcat="mycat";    
    string public name;

    Counters.Counter private totalMaintainers;
    Counters.Counter private totalUsers;
    mapping(address=> User) public users; //mapping to get user details from user address
    mapping(address=>bool) public isMaintainer; //to 
    mapping(address=>uint) private maintainerId;
    mapping(string=>address) public userAddressFromUsername; // to get user address from username
    mapping(string=>bool) private usernames;//to check which username is taken taken=>true, not taken=>false

    modifier onlyOwner{require(msg.sender==owner,"You are not owner!");_;}

    modifier stopInEmergency{require(!stopped,"Dapp has been stopped!");_;}
    modifier onlyInEmergency{require(stopped);_;}
    modifier usernameTaken(string memory username){require(!usernames[username],"Username already taken");_;}
    modifier checkUserNotExists(address user){require(users[user].status==accountStatus.NP,"User already registered");_;}

    event logRegisterUser(uint id, address ethAdress, string name, string username, string email, string password, string profileImgHash, accountStatus status);
    struct User{
        uint id;
        address ethAdress;
        string name;
        string username;
        string email;
        string password;
        string profileImgHash;
        accountStatus status; //Account Banned or Not
    }
    ///@dev NP means not present the default value for status
    enum accountStatus{NP, Active, Banned, Deactivated}
    constructor() public{
        owner=payable(msg.sender);
        addMaintainer(msg.sender);
    }
    function addMaintainer (address _user) public onlyOwner{
        isMaintainer[_user]=true;
        totalMaintainers.increment();
        maintainerId[msg.sender]=totalMaintainers.current();
    }
    function registerUser( string memory _name,string memory _username, string memory _email, string memory _password, string memory _imgHash) public {
        usernames[_username]=true; //attack prevented
        totalUsers.increment();
        uint id=totalUsers.current();
        users[msg.sender]=User(id, msg.sender, _name,  _username,_email, _password, _imgHash, accountStatus.Active);
        userAddressFromUsername[_username]=msg.sender;
        emit logRegisterUser(id, msg.sender, _name,  _username,_email, _password, _imgHash, accountStatus.Active);
    }

    function showusername(string memory _username) public view returns(address,uint){
        return (userAddressFromUsername[_username],totalUsers.current());
    }
    function usernameAvailable(string memory _username) public view returns(bool status){
        return !usernames[_username];
    }
    function userStatus() public view returns(accountStatus status){
        return users[msg.sender].status;
    }
    function getUser(address _user) public view returns(uint , string memory , string memory , string memory , string memory , string memory ){
        return(users[_user].id, users[_user].username, users[_user].name, users[_user].email, users[_user].password, users[_user].profileImgHash);
    }

}
